  \"Variable Fidelity Aeroelastic Toolkit - Structural Model Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:08:05.687449\",\n\t\"name\": \"variable-fidelity-aeroelastic-toolkit-structural-model-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed innovation is a methodology
  to incorporate variable fidelity structural models into steady and unsteady aeroelastic
  and aeroservoelastic analyses in order to utilize the appropriate level of fidelity
  for the problem at hand.  Some aeroelastic problems require detailed finite element
  modeling of the structure and servoelastic systems, or a detailed FEM may be the
  only structural model available.  Other problems, such as efficient modeling of
  wind tunnel models and flight vehicles or multidisciplinary optimization (MDO),
  benefit from the relative simplicity of reduced order structural models.  The unique
  value of this innovation is the ability to rapidly and repeatedly handle the significant
  difficulty of moving from a detailed model to a reduced order model and then carrying
  any subsequent design or optimization changes back to the higher order detailed
  structural model. The proposed methodology will automate the process of projecting
  lower order model changes, for example after an MDO application, back to the original
  (source) higher order model.  The methodology will contribute to integrated design
  optimization tools that can synergistically vary the simulation fidelity to find
  optimum solutions using design variables from more than one discipline.\",\n\t\"license_title\":
